using System;
using System.Collections.Generic;
using Newtonsoft.Json;
using NUnit.Framework;
using Plunge.Newtonsoft.Profiles;

namespace Plunge.Newtonsoft.Tests.Profiles
{
    public static class LauncherSerialization
    {
        [Test]
        public static void PrintSerializationSimple()
        {
            LauncherProfiles profiles = new()
            {
                ClientToken = "",

                LauncherVersion = new LauncherVersion
                {
                    Format = 21,
                    Name = "",
                    ProfilesFormat = 2
                },

                Profiles = new Dictionary<string, LauncherProfile>
                {
                    {
                        // GUIDs are traditional but Essential proves it doesn't matter.
                        "Forge 1.8.9 with Essential",

                        new LauncherProfile
                        {
                            Created = "2021-10-21T03:25:17.851Z",

                            // Directories are hard-coded.
                            GameDir = "C:\\Users\\xxlen\\AppData\\Roaming\\.minecraft\\essential_1.8.9",

                            // WHY
                            Icon = "data:image/png;base64,",

                            JavaArgs = "-Xmx2G -XX:+UnlockExperimentalVMOptions -XX:+UseG1GC -XX:G1NewSizePercent=20 -XX:G1ReservePercent=20 -XX:MaxGCPauseMillis=50 -XX:G1HeapRegionSize=32M -Duser.country=US -Duser.language=en",

                            LastUsed = "2021-10-21T03:44:58.837Z",

                            LastVersionId = "1.8.9-forge1.8.9-11.15.1.2318-1.8.9",

                            Name = "Forge 1.8.9 with Essential",

                            Type = "custom"
                        }
                    },

                    {
                        "be4752d4ccbb6a7468342b1b4d1419d0",
                        new LauncherProfile
                        {
                            Created = "1970-01-01T00:00:00.000Z",
                            Icon = "Crafting_Table",
                            LastUsed = "1970-01-01T00:00:00.000Z",
                            LastVersionId = "latest-snapshot",
                            Name = "",
                            Type = "latest-snapshot"
                        }
                    }
                },

                Settings = new LauncherSettings
                {
                    CrashAssistance = false,
                    EnableAdvanced = false,
                    EnableAnalytics = true,
                    EnableHistorical = false,
                    EnableReleases = true,
                    EnableSnapshots = false,
                    KeepLauncherOpen = true,
                    ProfileSorting = "ByLastPlayed",
                    ShowGameLog = true,
                    ShowMenu = false,
                    SoundOn = false
                }
            };

            string json = JsonConvert.SerializeObject(profiles, Formatting.Indented);
            Console.WriteLine(json);

            Assert.Pass();
        }
    }
}